import React, {Component} from "react";
import { Apisave, ApiurlUsers } from "../services/apirest";
import axios from "axios";
import Header from "../template/Header";


class Ingresar extends Component{
 

    numberRef = React.createRef();
    validatorRef = React.createRef();
    nameRef = React.createRef();
    last_nameRef = React.createRef();
    second_last_nameRef = React.createRef();
    birthdateRef = React.createRef();
    emailRef = React.createRef();
    passwordRef = React.createRef();
    codeRef = React.createRef();
    


    state = {
        form:{
               user:{}
        },
        error:false,
        errorMsg:""
    }

 
   
    changeState = () => {
        this.setState({
            article: {
                number: this.numberRef.current.value,
                validator: this.validatorRef.current.value,
                name: this.nameRef.current.value,
                last_name: this.last_nameRef.current.value,
                second_last_name: this.second_last_nameRef.current.value,
                birthdate: this.birthdateRef.current.value,
                email: this.emailRef.current.value,
                password: this.passwordRef.current.value,
                code: this.codeRef.current.value
            }
        });
    }

    saveArticle = (e) => {
        e.preventDefault();

        // Rellenar state formulario
        this.changeState();

        
    }


    manejadorChange = async e => {
      await this.setState({
          form:{
              ...this.state.form,
              [e.target.name]: e.target.value
          }
      })
   
}

manejadorSubmit = e => {
  e.preventDefault();
}






post  = () =>{
    let userId = this.props.match.params.id;
    let url = Apisave; 

   
     axios.post(url,this.state.form)
     .then (response =>{
        this.props.history.push("/dashboard");
     })
  }

 
    render(){

     
        return(
               
            <React.Fragment>

            <Header/>

            <div className="container">
                    <h3>Ingresar Usuario </h3>
            </div>
            <div className="container">
              <br/>
              <form className="form horizontal" onSubmit={this.saveArticle}>

              <div className="row">
                     <div className="col-sm-8">
                    <label className="col-md-2 control-label">Rut</label>
                    <div className="col-md-8">
                        <input className="form-control" name="number" placeholder="number" type="text" onChange={this.changeState} />
      
                      </div>
               </div>
                </div>
              <br/>

              <div className="row">
                     <div className="col-sm-8">
                    <label className="col-md-2 control-label">Digito verificador</label>
                    <div className="col-md-8">
                        <input className="form-control" name="validator" placeholder="digito verificador" type="text" onChange={this.changeState} />
      
                      </div>
               </div>
                </div>
              <br/>

              <div className="row">
                     <div className="col-sm-8">
                    <label className="col-md-2 control-label">Nombre</label>
                    <div className="col-md-8">
                        <input className="form-control" name="nombre" placeholder="nombre" type="text" onChange={this.changeState}/>
      
                      </div>
               </div>
                </div>
              <br/>

              <div className="row">
                     <div className="col-sm-8">
                    <label className="col-md-2 control-label">Apellido</label>
                    <div className="col-md-8">
                        <input className="form-control" name="last_name" placeholder="apellido" type="text"  onChange={this.changeState}/>
      
                      </div>
               </div>
                </div>
              <br/>

              <div className="row">
                     <div className="col-sm-8">
                    <label className="col-md-2 control-label">Segundo apellido</label>
                    <div className="col-md-8">
                        <input className="form-control" name="second_last_name" placeholder="segundo apellido" type="text" onChange={this.changeState}/>
      
                      </div>
               </div>
                </div>
              <br/>


              <div className="row">
                     <div className="col-sm-8">
                    <label className="col-md-2 control-label">Fecha de nacimiento</label>
                    <div className="col-md-8">
                        <input className="form-control" name="birthdate" placeholder="Fecha de nacimiento" type="text"   onChange={this.changeState} />
                      
                      </div>
               </div>
                </div>
              <br/>

              <div className="row">
                     <div className="col-sm-8">
                    <label className="col-md-2 control-label">Email</label>
                    <div className="col-md-8">
                        <input className="form-control" name="email" placeholder="email" type="text"   onChange={this.changeState}/>
                       
                      </div>
               </div>
                </div>
              <br/>

              <div className="row">
                     <div className="col-sm-8">
                    <label className="col-md-2 control-label">Password</label>
                    <div className="col-md-8">
                        <input className="form-control" name="password" placeholder="contraseÃ±a" type="text"  onChange={this.changeState} />
                    
                      </div>
               </div>
                </div>
              <br/>

              <div className="row">
                     <div className="col-sm-8">
                    <label className="col-md-2 control-label">role</label>
                    <div className="col-md-8">
                        <input className="form-control" name="code" placeholder="rol" type="text"   onChange={this.changeState}/>
                      
                      </div>
               </div>
                </div>
              <br/>

                







              
              







              <br/>
                <button type="submit" className="btn btn-primary" style={{marginRight:"10px"}} onClick={()=>this.post()} >Guardar</button>
                <a className="btn btn-dark" href="/dashboard" >Salir</a>

              </form>
            </div>

            </React.Fragment>
        
               
        );
    }

}


export default Ingresar;
